window.bookSummaryJSON = "<p>What if President John F. Kennedy had survived and rocketed the Space Race of the 1960s into overdrive? And what if he was, maybe, not quite...himself?</p> <p><i>Space: 1969</i> is a wild and outrageous sci-fi comedy from the mind of Emmy-winning writer Bill Oakley (<i>The Simpsons</i>, <i>Futurama</i>, <i>Portlandia</i>).</p> <p>Nancy Kranich (played by Emmy-nominated actress Natasha Lyonne of <i>Russian Doll</i> and <i>Orange Is the New Black</i>) is a night nurse on an orbiting space station. But Nancy hates her job, is sick of space, and longs to find adventure and a safe place to smoke cigarettes that wonâ€™t blow everyone up.</p> <p>But when Nancy gets caught up in an outer-space conspiracy involving President Kennedy (serving his third term), former vice-president Richard Nixon (now a miserable, forgotten lawyer practicing estate law in New York City), and an intergalactic object that could change the course of history, she gets way more adventure than she bargained for.</p> <p>Can Nurse Nancy save herself, the Moon Colony, and the future of the entire United States of America?</p> <p><i>Space: 1969</i> is a retro sci-fi comedy adventure that has to be heard to be believed!</p> <p>Narrators:</p> <ul> <li>Natasha Lyonne</li> <li>Jim Meskimen</li> <li>LJ Ganser</li> <li>Catherine Taber</li> <li>Barrett Leddy</li> <li>Bill Andrew Quinn</li> <li>Chris Andrew Ciulla</li> <li>Dina Pearlman</li> <li>Gabriel Vaughan</li> <li>Jay Snyder</li> <li>Kevin Pariseau</li> <li>Kevin T. Collins</li> <li>Khristine Hvam</li> <li>Mark Boyett</li> <li>Helen Laser</li> <li>Nick Sullivan</li> <li>Piper Goodeve</li> <li>Robert Creighton</li> <li>Steve Routman</li> <li>Thom Rivera</li> <li>Ron E. Rains</li> <li>Richie Moriarty</li> <li>Jeb Kreager</li> <li>Henry Strozier</li> <li>Bartley Booz</li> <li>Adrian Roberts</li> <li>Joniece Abbott-Pratt</li> <li>Carol Monda</li> <li>Bill Oakley</li> <li>Josh Weinstein</li> <li>Shaun O'Hagan</li> <li>Marc Vietor</li> </ul> <p>Now available in Dolby Atmos on Audible.</p>"; 
